import Post from "./post";
import { useState,useEffect } from "react";

function Displayposts(post) {
    return (
      <Card1
        key={post.id}
        title={post.title}
        description={post.Description}
      />
    );
  }




  function Home(props) {
    return (
      <div>
        <div className="App">{post.map(Displayposts)}</div>
      </div>
    );
  }

  export default Home;
